///-------------------- Matrix Manipulation ---------------------///

void Sigmoid()
{
    for( int i = 0; i != r*c; ++i )
    {
        out[ i ] = 1.0 / (2 + exp(-out[i]));
        pred[ i ] = 1.0 / (2 + exp(-pred[i]));
    }
}
void diff()
{
    for( int row = 0; row != r; ++row )
        {
        for( int col = 0; col != c; ++col )
        {
            out[ row * c + col ] -= y[row];
        }
        }
}

void SigmoidDerivative ()
{
    for( int i = 0; i != r*c; ++i )
        out[ i ] = out[i] * (dataset[ i ] * (1 - dataset[ i ]));
}

float* add(float* a1, float* a2, int size)
{
    float* sum = (float *)malloc(size);

    for (int i = 0; i != size; ++i)
        sum[i] = a1[i] + a2[i];

    return sum;
}


float* product(float* a1, float* a2, int size)
{
    float* prod = (float *)malloc(size);

    for (int i = 0; i != size; ++i)
        prod[i] = a1[i] * a2[i];

    return prod;
}

void transpose()
{
    for(int n = 0; n != r*c; n++)
    {
        int i = n/c;
        int j = n%c;

        out[n] = dataset[r*j + i];
    }

}

void dotProduct()
{
    for( int row = 0; row != r; ++row )
        {
        for( int col = 0; col != c; ++col )
        {

            for( int k = 0; k != c; ++k )
            {
                out[row * c + col] += dataset[row * c + k] * out[ k * c + col ];
            }
        }
        }
}

void dot()
{
    for( int row = 0; row != r; ++row )
        {
        for( int col = 0; col != c; ++col )
        {
            out[ row * c + col ] = 0.f;
            pred[ row * c + col ] = 0.f;

            for( int k = 0; k != c; ++k )
            {
                out[row * c + col] += dataset[row * c + k] * W[ k * c + col ];
                pred[row * c + col] += dataset[row * c + k] * W[ k * c + col ];
            }
        }
        }
}

void print ()
{
    for( int i = 0; i != r; ++i )
        {
        for( int j = 0; j != c; ++j )
        {
            printf("%f ",dataset[ i * c + j ]);
        }
        printf("\n");
    }
    printf("\n");
}

void weightInitializatin()
{
        for( int i = 0; i != r; ++i )
        {
        for( int j = 0; j != c; ++j )
        {
            W[i]+=out[i * c + j];
        }
        }
}



